import base64
import os
import platform

thisdir = os.path.abspath(os.path.dirname(__file__))

encoded_so = ''
encoded_dylib = 'None'
encoded_dll = ''

osname = platform.system()
libbytes = None
if (osname == 'Linux'):
    if (encoded_so is None):
        raise RuntimeError(__file__ + ' does not contain the runtime library for Linux')
    outname = os.path.join(thisdir, 'libeisdk.so')
    if (not os.path.exists(outname)):
        libbytes = base64.b64decode(encoded_so)
elif (osname == 'Darwin'):
    if (encoded_dylib is None):
        raise RuntimeError(__file__ + ' does not contain the runtime library for macOS')
    outname = os.path.join(thisdir, 'libeisdk.dylib')
    if (not os.path.exists(outname)):
        libbytes = base64.b64decode(encoded_dylib)
elif (osname == 'Windows'):
    if (encoded_dll is None):
        raise RuntimeError(__file__ + ' does not contain the runtime library for Windows')
    outname = os.path.join(thisdir, 'eisdk.dll')
    if (not os.path.exists(outname)):
        libbytes = base64.b64decode(encoded_dll)
else:
    raise RuntimeError('Unknown system')

if (libbytes is not None):
    with open(outname, 'wb') as file:
        file.write(libbytes)
